import './IDHeader.css'
import Waffle from '../../Data/Waffle.svg'

const IDHeader = () => {
    return (
        <header className={'Header'}>
            <a href={"https://wafflestudio.com"} target={"_blank"}>
                <img src={Waffle} height={"58"} width={"54"}/>
            </a>
            <h1 id={'Title'}>와플고등학교 명단 관리 프로그램</h1>
        </header>
    )
}

export default IDHeader
